// src/main.js
import { createApp } from 'vue';
import App from './App.vue';
import store from './store';
import Lazyload from './plugins/lazyload'; // Importar o plugin lazyload

const app = createApp(App);

app.use(store);
app.use(Lazyload); // Usar o plugin

app.mount('#app');
